metrics.mql:
INJECT timepast
HEADER { "ann_iterator_init_latency_bucketDelta$":"#" }
OIDSET { oid:$oid, okind:$okind, onode:$onode }
CATEGORY {"telegraf_milvus_standalone":6h, "telegraf_milvus_standalone{m5}":3d, "telegraf_milvus_standalone{h1}":unlimit } 
TAGLOAD
INJECT default
UPDATE { key: ['ann_iterator_init_latency_bucketDelta'], value: $TIME_MERGE_PLACE }
SELECT [ 'pcode', 'time', 'oid','oname', 'ann_iterator_init_latency_bucketDelta', 'le', 'module' ]
FILTER { key: "ann_iterator_init_latency_bucketDelta", exist: true }
FILTER { key: "le", exist: true }
FILTER { key: "module", exist: true }

CREATE { key:_id_, expr: "oid+'_'+le+'_'+module" }
CREATE { key:_name_, expr: "le+' '+module+' '+oname" }
GROUP { timeunit: 10s, merge: ['ann_iterator_init_latency_bucketDelta'], pk: _id_, last: _name_ }
UPDATE { key: ['ann_iterator_init_latency_bucketDelta'], value: $OBJECT_MERGE_PLACE }

